using System.ComponentModel.Composition;
using XrmToolBox.Extensibility;
using XrmToolBox.Extensibility.Interfaces;

namespace Netwise.XrmToolBox.RolesHelper
{
    /// <summary>
    /// Base class which is described as Plugin.
    /// </summary>
    [Export(typeof(IXrmToolBoxPlugin)),
    ExportMetadata("BackgroundColor", "White"), // The color used as background for the plugin in the XrmToolBox plugins list.
    ExportMetadata("PrimaryFontColor", "#000000"), // The color used for the text displayed in the XrmToolBox plugins list.
    ExportMetadata("SecondaryFontColor", "DarkGray"), // The color used for the author of the plugins in the XrmToolBox plugins list (only used when displaying small plugins list).
    ExportMetadata("SmallImageBase64", ""), // A base64 encoded 32px/32px image used as the plugin logo in the XrmToolBox small plugins list.
    ExportMetadata("BigImageBase64", ""), // A base64 encoded 80px/80px image used as the plugin logo in the XrmToolBox big plugins list.
    ExportMetadata("Name", "Netwise.XrmToolBox.RolesHelper ©"), // The name of the plugin as displayed in XrmToolBox plugins list.
    ExportMetadata("Description", "Plugin used to operate on CRM Roles. Compare, copy, etc.")] // The description of the plugin as displayed in XrmToolBox plugins list.
    public class Plugin : PluginBase
    {
        /// <summary>
        /// Returns control connected with this Plugin.
        /// </summary>
        public override IXrmToolBoxPluginControl GetControl()
        {
            return new PluginControl();
        }
    }
}